import React, { useState } from "react";

const Index = () => {
  const [item, setItem] = useState(new Array(9).fill(false));
  return (
    <div>
      <div className="grid-cols-3">
        {item.map((el, index) => {
          return (
            <div className="w-40 h-40 border-teal-500 bg-lime-500">
              {index + 1}
            </div>
          );
        })}
      </div>
    </div>
  );
};

export default Index;
